const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		width: "100%",
		height: "auto"
	},
	gridImg: {
		width: "66.6667% !important",
	    height: "164px !important",
	    padding: "2px !important"
	},
	imgFullHeight : {
		padding: "15px"
	}
};

export default ImageGridListStyle;
